import {useState} from "react";
import Box from "@mui/material/Box";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import ListItemButton from "@mui/material/ListItemButton";
import Typography from "@mui/material/Typography";
import ListItemText from "@mui/material/ListItemText";

import Accordion from '@mui/material/Accordion';
import AccordionDetails from '@mui/material/AccordionDetails';
import AccordionSummary from '@mui/material/AccordionSummary';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';


export default function Nav() {
    // Styles
    const boxSx = {
        bgcolor: "background.paper",
        width: "100%"
    };

    const listItemTextSx = {
        color: "#1769aa",
        fontSize: "36px",
        textAlign: "center"
    };

    const listItemButtonSx = {
        padding: "40px"
    };

    const [expanded, setExpanded] = useState('panel1');

    const handleChange = (panel) => (event, newExpanded) => {
        setExpanded(newExpanded ? panel : false);
    };

    return (
        <Box sx={boxSx}>

            <nav aria-label="medication nav">
                <List>
                    <Accordion expanded={expanded === 'panel1'} onChange={handleChange('panel1')}>
                        <AccordionSummary aria-controls="panel1d-content" id="panel1d-header"
                                          expandIcon={<ExpandMoreIcon/>} sx={{padding: 5, bgcolor: "#eaeef3"}}>
                            <Typography sx={listItemTextSx}>Collapsible Group Item #1</Typography>
                        </AccordionSummary>
                        <AccordionDetails sx={{margin: 0, padding: 5}}>
                            <ListItem disablePadding>
                                <ListItemButton component="a" href="/add-medication" sx={listItemButtonSx}>
                                    <ListItemText disableTypography
                                                  primary={<Typography sx={listItemTextSx}>Add
                                                      Medications</Typography>}/>
                                </ListItemButton>
                            </ListItem>
                            <ListItem disablePadding>
                                <ListItemButton component="a" href="/medications" sx={listItemButtonSx}>
                                    <ListItemText disableTypography
                                                  primary={<Typography sx={listItemTextSx}>Manage
                                                      Medications</Typography>}/>
                                </ListItemButton>
                            </ListItem>
                        </AccordionDetails>
                    </Accordion>
                </List>
            </nav>
        </Box>
    );
}
